import  { GET_LOGIN_ERRORS } from '../actions/types';
const initialState = { };

const errorsReducer = (state = initialState, action) => {
    switch(action.type){
        case GET_LOGIN_ERRORS:
            return action.payload; // return response error
        default: return state;
    }
};

export default errorsReducer;
